# --- Risk severity/category helpers (exec summary) ---
_SEV_RANK = {
    "critical": 4,
    "high": 3,
    "medium": 2,
    "med": 2,
    "low": 1,
    "informational": 0,
    "info": 0,
}

def _norm_sev(s: str) -> str:
    t = (s or "").strip().lower()
    if not t:
        return "Low"
    if t in ("informational", "info"):
        return "Informational"
    if t in ("med",):
        return "Medium"
    return t.capitalize()

def _sev_rank(s: str) -> int:
    return int(_SEV_RANK.get((s or "").strip().lower(), 1))

def _infer_category_from_text(text: str) -> str:
    blob = (text or "").strip().lower()
    for area, keys in (TRIGGER_KEYWORDS or {}).items():
        for k in keys:
            if k in blob:
                return area
    # fallback category
    return "project_level"

def _group_risks_by_category(risks: list[dict]) -> dict:
    out = {}
    for r in (risks or []):
        if not isinstance(r, dict):
            continue
        cat = str(r.get("category") or "").strip().lower()
        if not cat:
            cat = _infer_category_from_text(str(r.get("label") or r.get("id") or ""))
        r["category"] = cat
        out.setdefault(cat, []).append(r)
    return out

def _build_risk_summary(risks: list[dict], tier_counts: dict) -> dict:
    # compute max severity
    max_rank = -1
    max_sev = "Low"
    drivers = []
    for r in (risks or []):
        sev = _norm_sev(str(r.get("severity") or "Low"))
        rk = _sev_rank(sev)
        if rk > max_rank:
            max_rank = rk
            max_sev = sev
        # pick first few high-signal labels as drivers
        lbl = str(r.get("label") or "").strip()
        if lbl and len(drivers) < 8:
            drivers.append(lbl)

    # overall level (deterministic)
    overall = "Low"
    if max_rank >= 3:
        overall = "High"
    elif max_rank == 2:
        overall = "Moderate"
    else:
        # bump to Moderate if many tier2 findings
        t2 = int((tier_counts or {}).get("tier2_heuristics", 0)) + int((tier_counts or {}).get("tier2_sections", 0))
        if t2 >= 2:
            overall = "Moderate"

    by_cat = {k: len(v) for k, v in _group_risks_by_category(risks).items()}
    ai_only_count = len([r for r in (risks or []) if str(r.get("category") or "") == "ai_identified_risk"])

    stmt = (
        f"Overall Risk Assessment: {overall}. "
        f"Max severity observed: {max_sev}. "
        f"Findings include Tier3={int((tier_counts or {}).get('tier3_flags',0))}, "
        f"Tier2={int((tier_counts or {}).get('tier2_heuristics',0)) + int((tier_counts or {}).get('tier2_sections',0))}, "
        f"Tier1={int((tier_counts or {}).get('tier1_inference',0))}. "
        f"Risk areas identified: {', '.join(sorted(by_cat.keys())) if by_cat else 'None'}."
    )

    return {
        "overall_level": overall,
        "max_severity": max_sev,
        "tier_counts": tier_counts or {},
        "by_category": by_cat,
        "ai_only_count": ai_only_count,
        "drivers": drivers,
        "overall_statement": stmt,
    }

# Small utilities
# =============================================================================
def _env(name: str, default: str = "") -> str:
    v = os.getenv(name)
    return default if v is None else str(v)


def _fast_enabled() -> bool:
    return (_env("RAG_FAST", "0").strip() == "1")


def _normalize_text(s: str) -> str:
    if not s:
        return ""
    s = s.replace("\r\n", "\n").replace("\r", "\n")
    s = s.replace("\x00", "")
    s = s.replace("\u2013", "-").replace("\u2014", "-")
    s = s.replace("\u2018", "'").replace("\u2019", "'")
    s = s.replace("\u201c", '"').replace("\u201d", '"')
    return s


def _collapse_blank_lines(s: str) -> str:
    s = _normalize_text(s)
    s = re.sub(r"\n{3,}", "\n\n", s)
    return s.strip() + "\n"


def _canonical_mode(mode: Optional[str]) -> str:
    m = (mode or "").strip().lower()
    if not m or m == "default":
        return RAG_MODE_DEFAULT
    if m not in RAG_ALLOWED_MODES:
        raise ValueError(f"Unsupported RAG mode: {m}. Allowed: {sorted(RAG_ALLOWED_MODES)}")
    return m


# =============================================================================
# Output section hardening
# =============================================================================
def _canon_header_line(raw: str) -> str:
    """
    Normalize LLM header lines so we can detect sections even when the model emits markdown like **OVERVIEW** or 'OVERVIEW:'.
    """
    s = (raw or "").strip()
    if not s:
        return ""
    # remove common markdown wrappers
    s = s.replace("**", "").replace("__", "").strip()
    # normalize trailing punctuation
    s = re.sub(r"[:\-\s]+$", "", s).strip()
    # collapse whitespace
    s = re.sub(r"\s{2,}", " ", s).strip()
    return s


def _is_section_header_line(raw: str) -> Optional[str]:
    """
    Returns the canonical header string if this line represents a section header, else None.
    """
    cand = _canon_header_line(raw)
    if not cand:
        return None

    # exact match
    if cand in RAG_REVIEW_SUMMARY_SECTIONS:
        return cand

    # allow case-insensitive match
    cand_u = cand.upper()
    for h in RAG_REVIEW_SUMMARY_SECTIONS:
        if cand_u == h.upper():
            return h

    return None

def _split_sections(text: str) -> Dict[str, str]:
    lines = _normalize_text(text).split("\n")
    sections: Dict[str, List[str]] = {}
    current: Optional[str] = None
    header_set = set(RAG_REVIEW_SUMMARY_SECTIONS)

    for raw in lines:
        line = raw.strip()
        canon = _is_section_header_line(line)
        if canon:
            current = canon
            sections[current] = []
            continue
        if current is not None:
            sections[current].append(raw)

    return {k: "\n".join(v).strip() for k, v in sections.items()}


def _render_sections_in_order(sections: Dict[str, str], order: List[str]) -> str:
    out: List[str] = []
    for h in order:
        body = (sections.get(h) or "").strip()
        if not body:
            body = INSUFFICIENT
        out.append(h)
        out.append(body)
        out.append("")
    return "\n".join(out).rstrip() + "\n"


