    stats: Dict[str, Any] = {
        "top_k_requested": int(top_k),
        "top_k_effective": int(effective_top_k),
        "context_used_chars": int(len(context or "")),
        "context_max_chars": int(context_cap),
        "retrieved_total": int(retrieved_total),
        "retrieved_counts": retrieved_counts,
        "risk_objects": tier_counts,
        "risk_summary": risk_summary,
        "multipass_narrative_enabled": bool(multipass_used),
        "multipass_narrative_sections": int(multipass_sections),
        "tier1_autogen_count": int(tier1_autogen_count),
    }
    if ingest_stats is not None:
        stats["ingest"] = ingest_stats

    if debug:
        stats["debug_context_len"] = len(context or "")
        stats["debug_llm_error"] = llm_err

        _dbg_ctx = (context or "")
        if intent == "risk_triage" and (signals or "").strip():
            _dbg_ctx = (signals.strip() + "\n\n" + _dbg_ctx).strip()
        stats["debug_context"] = _dbg_ctx[:6000]

        stats["debug_prompt_prefix"] = (prompt or "")[:1500]
        stats["debug_prompt_len"] = len(prompt or "")
        # DEBUG: determine if Bedrock returns empty only for long prompts (length/content isolation)
        try:
            def _smoke_len(n: int) -> None:
                try:
                    _out = llm.generate((prompt or "")[:n], max_tokens=128, temperature=0.0, top_p=1.0)
                    _t = ""
                    if isinstance(_out, dict):
                        _t = str(_out.get("text") or "")
                    elif isinstance(_out, str):
                        _t = _out
                    _t = (_t or "").strip()
                    stats[f"debug_llm_smoke_prompt_{n}_text_len"] = len(_t)
                    stats[f"debug_llm_smoke_prompt_{n}_preview"] = _t[:120]
                except Exception as e:
                    stats[f"debug_llm_smoke_prompt_{n}_error"] = repr(e)

            _smoke_len(2000)
            _smoke_len(6000)
        except Exception:
            pass
        stats["debug_llm_raw_prefix"] = (llm_text or "")[:1500]
        stats["debug_llm_text_len"] = len(llm_text or "")
        stats["retrieval_debug"] = retrieval_debug
        # DEBUG: surface LLM call metadata + output sizing
        try:
            if isinstance(llm_debug, dict) and llm_debug:
                stats.update(llm_debug)
        except Exception:
            pass
        stats["debug_llm_text_len"] = len(llm_text or "")
        stats["debug_llm_text_preview"] = (llm_text or "")[:200]

    return {
        "review_id": review_id,
        "mode": m,
        "analysis_intent": intent,
        "context_profile": profile,
        "summary": summary,
        "sections": sections,
        "citations": [],
        "retrieved_counts": retrieved_counts,
        "risk_objects": tier_counts,
        "risk_summary": risk_summary,
        "multipass_narrative_enabled": bool(multipass_used),
        "multipass_narrative_sections": int(multipass_sections),
        "tier1_autogen_count": int(tier1_autogen_count),
        "risks": risks,
        "risk_areas_identified": risk_areas_identified,
        "risk_areas": risk_areas,
        "risk_areas_identified": risk_areas_identified,
        "risk_areas": risk_areas,
        "warnings": warnings,
        "stats": stats,
    }


